import MyAppBar from "../AppBar/MyAppBar";
import { Outlet } from "react-router-dom";
import { lightGreen } from "@mui/material/colors";

export default function Layout(){

    return(
        <>
            <div style={{backgroundColor: lightGreen}}>
                <MyAppBar/>
                <Outlet/>
            </div>
        </>
    )
}
